INSERT INTO `notice` (`noticeID`, `title`, `notice`, `year`, `date`, `create_date`) VALUES
(1, 'Оюутны бүртгэлийн системийн танилцуулга', '<p class="rvps5">Тус систем нь СИТИ их сургуулийн сургалт, удирдлага, зохион байгуулалттай холбоотой үйл ажиллагааг хөнгөвчлөх, чанаржуулах, шуурхай, найдвартай, ил тод, хяналттай болгох зорилготой вэб-д суурилсан сургалтын мэдээллийн систем юм.&nbsp;</p><p class="rvps5">Энэхүү системийг багш ажилтан, оюутан болон удирдлагууд хэрэглэх боломжтой.&nbsp;</p><p class="rvps5">Холбоо барих утас: 99223209, 88061520. e-mail: admin@citi.edu.mn &nbsp;</p><p class="rvps5">www.citi.edu.mn<br></p>', 2016, '2016-11-18', '2016-12-13 02:15:29'),
(2, 'Нийт багш, оюутнуудын анхааралд', 'Та бүхэн <b>Шинэ нууц үгээр</b> нэвтэрч ороод <b><u>найвдвартай нууц үгээр сольж</u></b> авна уу. <br>', 2016, '2016-11-18', '2016-11-18 09:06:53'),
(3, 'Оюутнуудын анхааралд', 'Улирлын шалгалт 2016 оны 12-р сарын 23-аас эхлэж 2017 оны 01-р сарын 06-ны өдөр хүртэл явагдна. Та бүхэнд амжилт хүсье.&nbsp;', 2016, '2016-12-13', '2016-12-13 02:20:11'),
(4, 'Нийт оюутнуудын анхааралд', '<span Lucida Console", "Courier New", monospace; font-size: 12px; white-space: pre-wrap;">Мэдээллийн аюулгүй байдлын үүднээс системд нэвтрэх анхны нууц үгээ солино уу. Мөн өөрийн системд нэвтрэх хэрэглэгчийн нэр, нууц үгээ бусдаас нууцлахыг хүсье.</span>', 2017, '2017-01-23', '2017-01-23 08:13:02');
